import React from 'react';

import Grid from './Grid';
import 'Board.css';

function Board({ enabled, active }) {
  const matriz = [
    [
      {
        enabled: true
      },
      {
        enabled: false
      },
      {
        enabled: false
      }
    ],
    [
      {
        enabled: true
      },
      {
        enabled: true
      },
      {
        enabled: false
      }
    ],
    [
      {
        enabled: false
      },
      {
        enabled: false
      },
      {
        enabled: false
      }
    ]
  ]
  return (
    <div className="board">
      {matriz.map(row => (
        row.map(grid =>
          <Grid enabled={grid.enabled} />
        )
      ))}
    </div>
  );
}

export default Board;
